import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import validation from './signupValidation';


function Signup() {

    const [gender, setGender] = useState('');

    const handleChange = (event) => {
        setGender(event.target.value);
    }

    const [dob, setDob] = useState('');

    const handleDateChange = (event) => {
        setDob(event.target.value);
    }

    const [values, setValues] = useState({
        firstName: '',
        lastName: '',
        email: '',
        password: '',
        gender: '',
        dob: ''
    })

    const [errors, setErrors] = useState({})

    const handleInput = (event) => {
        setValues(prev =>({...prev, [event.target.name]: [event.target.value] }))
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        setErrors(validation(values));
    }

    return (
        <div className='d-flex justify-content-center align-items-center bg-black vh-100'>
            <div className='bg-white p-3 rounded w-25'>
                <h2>Sign-Up</h2>
                <form action="">
                    <div className='mb-3'>
                        <label htmlFor="fname"><strong> First Name</strong></label>
                        <input type="fname" placeholder='Enter First Name' name = 'fname'
                        className='form-control rounded-0'/>

                    </div>
                    <div className='mb-3'>
                        <label htmlFor="lname"><strong> Last Name</strong></label>
                        <input type="lname" placeholder='Enter Last Name' name = 'lname'
                        className='form-control rounded-0'/>

                    </div>
                    <div className='mb-3'>
                        <label htmlFor="email"><strong>Email</strong></label>
                        <input type="email" placeholder='Enter Email' className='form-control rounded-0'/>

                    </div>
                    <div className='mb-3'>
                        <label htmlFor="password"><strong>Password</strong></label>
                        <input type="password" placeholder='Enter Password' className='form-control rounded-0'/>

                    </div>
                    <div>
                        <label htmlFor="gender"><strong>Gender</strong></label>
                        <select id="gender" value={gender} onChange={handleChange}>
                        <option value="">Select Gender</option>
                        <option value="M">Male</option>
                        <option value="F">Female</option>
                        </select>
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="hometown"><strong>Hometown</strong></label>
                        <input type="hometown" placeholder='Enter Hometown' className='form-control rounded-0'/>

                    </div>
                    <div>
                        <label htmlFor="dob"><strong>Date of Birth</strong></label>
                        <input type="date" id="dob" value={dob} onChange={handleDateChange} />
                    </div>
                    <button className='btn btn-success w-100 rounded-0'><strong>Sign up</strong></button>
                    <p></p>
                    <Link to="/" className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none'>Log in</Link>                </form>
            </div>
        </div>
    )
}

export default Signup
